- input: "TEXT\x1CC00279901\x1CX0\x1C\x1CF3XA\x1CWe are resubmitting our previously
    amended June 20, 2012 Monthly Report to reflect the correct signature date. It
    was recently discovered that Christine M. Weber-Rogers had a duplicate record
    in our database. The record had an aggregate of less than $200.01 so the contribution
    was not itemized on the original report. Additionally, it was discovered that
    unitemized expenses totaling $2.05 to American Express for banking fees were not
    included in our original filing.    Please be assured that we are taking all necessary
    steps to ensure that these transactions and banking fees are properly reported
    in the future. If any further action is needed, please contact me at (608) 831-7877.
